import React from 'react';
import Load from './loading.gif';
export default class Loading extends React.Component {
  constructor(props) {
    super();
    this.state = {}
  }
  render() {
    return (
      <div style={{
        width: 261,
        height: 295,
        position: 'absolute'
      }}>
        <span style={{
          width: 16,
          height: 32,
          background: `url(${Load}) no-repeat`,
          display: 'block',
          margin: '140px auto'
        }}></span>
      </div>
    )
  }
}
